import { useState } from "react";
import "./Page3.css";

function Page3() {
  const [selectPlayer, seStelectPlayer] = useState(null);

  return (
    <div className="app">
      <div className="bg3">
        <span>
          <button className="buttonPlayer1">PLAYER 1</button>
          <button className="buttonPlayer2">PLAYER 2</button>
        </span>
        <div className="text">PLAYER1</div>
      </div>
    </div>
  );
}

export default Page3;
